import React, { Component } from 'react';

class App extends Component {
  render() {
    return (
      <form class="books_add">

      <label> </label>
      <input name="title" type="text" />
      <input name="author" type="text" />
      <input name="bookfile" type="file" />
      <input type="submit" />

      </form>

    );
  }
}

export default App;
